- input: "TEXT\x1CC00005249\x1C10340581\x1C\x1CF3XN\x1COn September 30, 2011, at the
    request of candidate for New York Congressional District 26 Dan Maffei, NAIFA
    PAC authorized redesignation of a 2010 $5,000 contribution to NY Victory Fund
    to a 2012 Primary Election contribution to Maffei for Congress. The candidate
    advised NAIFA PAC that the $5,000 contribution had not been spent by the NY Victory
    Fund on expenses associated with the recount of the votes in the November, 2010
    general election. Mr. Maffei has declared his candidacy for the 2012 election,
    and requested that the recount election contribution be redesignated as a contribution
    in connection with the 2012 primary election. NAIFA PAC sent the authorization
    of the redesignation to the Maffei for Congress campaign on September 30, 2011.
